/**
 * Prints the drawing.
 */
public void print() {
    tool().deactivate();
    PrintJob printJob = getToolkit().getPrintJob(this, "Print Drawing", null);
    if (printJob != null) {
        Graphics pg = printJob.getGraphics();
        if (pg != null) {
            ((StandardDrawingView) view()).printAll(pg);
            // flush page
            pg.dispose();
        }
        printJob.end();
    }
    tool().activate();
}
